    "Discard Changes": "\u0421\u043a\u0430\u0441\u0443\u0432\u0430\u0442\u0438 \u0437\u043c\u0456\u043d\u0438", 
    "Discarding Changes": "\u0421\u043a\u0430\u0441\u0443\u0432\u0430\u043d\u043d\u044f \u0437\u043c\u0456\u043d", 
    "Discussion": "\u041e\u0431\u0433\u043e\u0432\u043e\u0440\u0435\u043d\u043d\u044f", 
    "Discussion Home": " \u041e\u0431\u0433\u043e\u0432\u043e\u0440\u0435\u043d\u044f \u0413\u043e\u043b\u043e\u0432\u043d\u0430 \u0441\u0442\u043e\u0440\u0456\u043d\u043a\u0430", 
    "Discussion topics in the course are not divided.": "\u0422\u0435\u043c\u0438 \u0434\u043b\u044f \u043e\u0431\u0433\u043e\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u043a\u0443\u0440\u0441\u0443 \u043d\u0435 \u043f\u043e\u0434\u0456\u043b\u0435\u043d\u043e", 
    "Discussions are unified; all learners interact with posts from other learners, regardless of the group they are in.": "\u041e\u0431\u0433\u043e\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u043e\u0431'\u0454\u0434\u043d\u0430\u043d\u043e, \u0432\u0441\u0456 \u0441\u043b\u0443\u0445\u0430\u0447\u0456 \u043c\u043e\u0436\u0443\u0442\u044c \u0447\u0438\u0442\u0430\u0442\u0438 \u0434\u043e\u043f\u0438\u0441\u0438 \u0432\u0441\u0456\u0445 \u0456\u043d\u0448\u0438\u0445 \u0441\u043b\u0443\u0445\u0430\u0447\u0456\u0432 \u0431\u0435\u0437\u0432\u0456\u0434\u043d\u043e\u0441\u043d\u043e \u0434\u043e \u0433\u0440\u0443\u043f\u0438. ", 
    "Display Name": "\u041d\u0430\u0437\u0432\u0430, \u0449\u043e \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454\u0442\u044c\u0441\u044f", 
