    "Earned %(created)s.": "\u041e\u0434\u0435\u0440\u0436\u0430\u043d\u043e %(created)s.", 
    "Earned Certificates": "\u041d\u0430\u0434\u0431\u0430\u043d\u0456 \u0441\u0435\u0440\u0442\u0438\u0444\u0456\u043a\u0430\u0442\u0438", 
